insert  into `blog_article`(`ID`,`title`,`author`,`time`,`label`,`titleImg`,`content`) values (1,'Hello，World','F_picacho','2020/1/21','前端','null','数据库结构测试'),(30,'POST测试','F_picacho','2020/1/13 下午9:47:03','后端','null','<p>hello world</p><p><img src=\"data:image/jpeg;base64,\"></p>'),(37,'zerotier Moon 搭建','F_picacho','2020/1/14 下午1:53:53','后端','null','<p><strong style=\"color: rgb(0, 166, 0);\">zerotier-one介绍</strong></p><pre class=\"ql-syntax\" spellcheck=\"false\">这是个好东西，打洞专用，使用UDP进行打洞，致力于开源SDN，SD-WAN解决方案，属于开源精品(仅仅是客户端开源，服务端不开源但是可以免费使用100个连接，所有这里用三方的开源组件搭建Moon端)．跨平台多终端\n将复杂的互联网用点对点的形式进行组建，并且在上面附加一层 VXLAN-like 虚拟网络层 来提高局域网的可见性，安全性.\n</pre><p><strong style=\"color: rgb(0, 166, 0);\">Zerotier 定义了几个专业名词,以及优势</strong></p><pre class=\"ql-syntax\" spellcheck=\"false\">#使用 zerotier-cli listpeers 命令时能看到这几个名词。充当 moon 的机子最好有公网 IP\n	PLANET	：行星服务器，	Zerotier 各地的根服务器，有日本、新加坡等地\n	Moon	：卫星级服务器，	用户自建的私有根服务器，起到中转加速的作用\n	LEAF 	：相当于各个枝叶，	就是每台连接到该网络的机器节点\n\n#zerotier-one优势\n	1：控制端（ZeroTier 官网）功能足够强大，可以下发路由表、准入控制、IP分配、流量规则等，\n	2：可以建立中转服务器（Moon 服务器）,从而实现更好的链接效果\n	3：接近于免费。个人用户最多可以接入 100 节点设备，\n	4：客户端开源。你完全可以自己编译\n</pre><p><strong style=\"color: rgb(0, 166, 0);\">搭建开源的Moon　卫星中转节点</strong></p><pre class=\"ql-syntax\" spellcheck=\"false\">#ztncui依赖于zerotier，所以需要先安装zerotier\n	curl -s https://install.zerotier.com | sudo bash\n\n#安装ztncui软件,并启动\n	yum install https://download.key-networks.com/el7/ztncui/1/ztncui-release-1-1.noarch.rpm -y\n	yum install ztncui -y\n	echo \"HTTPS_PORT = 3443\" &gt; /opt/key-networks/ztncui/.env\n\n	systemctl restart ztncui\n\n#web登录ztncui控制台\n	https://ip:3443\n	账户：admin\n	密码：password\n\n#将本机配置为moon节点\n	#进入zerotier-one的配置文件目录\n	cd /var/lib/zerotier-one\n	#在/var/lib/zerotier-one 目录下生成moon.json\n	zerotier-idtool initmoon identity.public &gt;&gt; moon.json\n\n	vi /var/lib/zerotier-one/moon.json\n	#将这行修改为\n	\"stableEndpoints\": [ \"主机ip1/9993\",\"主机ip2/9993\" ]\n\n	#生成签名文件，此命令会生成一个签名文件在当前目录下，文件名如 000000deadbeef00.moon （机器 A 的 id 为 deadbeef00)\n	zerotier-idtool genmoon moon.json\n\n	#关闭selinux\n\n#(备注)使用方式，及其他系统参看ztncui的社区文档\n	https://key-networks.com/ztncui/\n</pre><p><strong style=\"color: rgb(0, 166, 0);\">zerotier-one客户端安装</strong></p><pre class=\"ql-syntax\" spellcheck=\"false\">#linux安装zerotier-one\n	curl -s https://install.zerotier.com | sudo bash\n\n#linux若作为本地转发网关，需要关闭selinux\n\n#加入网络\n	zerotier-cli join xxxxxxxx\n</pre><p><strong style=\"color: rgb(0, 166, 0);\">zerotier-one客户如何加入自定义的Moon节点</strong></p><pre class=\"ql-syntax\" spellcheck=\"false\">#方法一：\n	zerotier-cli orbit deaxx22 deaxx22\n\n#方法二：\n	在客户端的zerotier-one配置目录，创建moons.d  并将Moon节点的/var/lib/zerotier-one/000000deadbeef00.moon 文件复制到刚才的moons.d目录下\n\n	#linux目录	/var/lib/zerotier-one/\n		mkdir /var/lib/zerotier-one/moons.d/\n	#windows目录 C:ProgramData\ZeroTierOne\n	#FreeBSD/OpenBSD目录: /var/db/zerotier-one\n\n	scp root@192.168.60.3:/root/000000106a05f02c.moon /var/lib/zerotier-one/moons.d/\n	zerotier-cli orbit 106a05fxxc 106a05fxxc\n	\n	#若是客户端作为本地转发网关，需要设置SNAT以及开启，内核转发 \n		#echo \"net.ipv4.ip_forward = 1\" &gt;&gt; /etc/sysctl.conf\n		#sysctl -p\n		#iptables -t nat -A POSTROUTING -s 192.168.255.29/24 -o br-lan -j SNAT --to-source 192.168.60.3\n</pre><p><strong style=\"color: rgb(0, 166, 0);\">zerotier-one客户端操作帮助</strong></p><pre class=\"ql-syntax\" spellcheck=\"false\">#客户端目录路径\n	cd /var/lib/zerotier-one\n\n#重启客户端\n	systemctl restart zerotier-one\n\n#zerotier-cli用法指引\n	zerotier-cli info			#查看当前zerotier-one的信息\n	zerotier-cli listpeers			#列出所有的peers\n	zerotier-cli listnetworks		#列出加入的所有的网络\n	zerotier-cli join &lt;network&gt;		#加入某个网络\n	zerotier-cli leave &lt;network&gt;		#离开某个网络\n	zerotier-cli listmoons			#列出加入的Moon节点\n	zerotier-cli orbit &lt;world ID&gt; &lt;seed&gt; 	#加入某个Moon节点\n	zerotier-cli deorbit &lt;world ID&gt; 	#离开某个Moon节点\n</pre><p><br></p>'),(38,'123000','F_picacho','2020/1/14 下午2:09:12','游戏','null','<p>12300012123156121212dsa2d3asdasdsa12315156156156151515615151561515156151515151d5sadbasvdgasduasdnsadasoiduyasgdyaukdopsadhuishdoajdajdopadjagdyahjdasdbhuasdhajdasjidgasyjdopasbdadhiadnahidiaadnauidhjoabdjiahdiapdjiaohd</p><p><br></p>');

